import React, {Component} from 'react';
import './App.css';
import { findDaysToShip } from './utils/util';

import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBBtn
} from 'mdb-react-ui-kit';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      products: []
    }
  }

  componentDidMount() {
    let url = "http://localhost:3002/products"
    fetch(url)
      .then(resp => resp.json())
      .then(data => {
        let products = data.map((product, index) => {
          return (
            <div name='work' className='w-full md:h-screen text-gray-300 bg-[#0a192f]'>
              <div className='max-w-[1000px] mx-auto p-4 flex flex-col justify-center w-full h-full'>
                <div className='pb-8 w-full flex justify-center items-center flex-col'>
                  <p className='text-4xl font-bold inline border-b-4 text-gray-300 border-cyan-500'>Products</p>
                  <p className='py-6 text-2xl'>Check out some of our products</p>
                </div>
              </div>
              <MDBCol sm='6'>
              <MDBCard>
              <MDBCardBody>
              <MDBCardTitle>{product.productName}</MDBCardTitle>
              <MDBCardText>{product.inventoryQuantity}</MDBCardText>
              <MDBCardText>Max Shipping Date If Ordered Today:{ findDaysToShip(product).toDateString() }</MDBCardText>
              </MDBCardBody>
              </MDBCard>
              </MDBCol>
            </div>
          )
        })
        this.setState({products: products});
      })
  }
  render() {
    return (
      <div className="App">
        {this.state.products}
      </div>
    );
  }
}

export default App;
